import{_ as s,o as d,c as h,a as e,b as t,w as n,d as a,e as m,r as i}from"../app.2f314514.mjs";const p="/assets/discord-modding.4be99099.png",u="/assets/mod-example.698338a4.png",l="data:image/png;base64,",c="/assets/leaderboard-id-format.b736f50c.png",g={},f=e("h1",{id:"how-do-i-get-my-map-ranked",tabindex:"-1"},[e("a",{class:"header-anchor",href:"#how-do-i-get-my-map-ranked","aria-hidden":"true"},"#"),a(" How do I get my map ranked?")],-1),y=e("p",null,"Before you consider pushing your first map for ranked, make sure to first fulfill these basic pre-requisitions:",-1),k=e("li",null,"The map is made and fully finished",-1),w=a("The map seems to meet every point from the "),b=a("ranking criteria"),v=e("li",null,"The map was play-tested by players and appear to not have any issues",-1),A=e("div",{class:"custom-container tip"},[e("p",{class:"custom-container-title"},"TIP"),e("p",null,"Once all the above-mentioned points are met, you can go ahead and read the rest of this page on on how to get your map modded and eventually ranked.")],-1),x=e("h2",{id:"what-is-modding",tabindex:"-1"},[e("a",{class:"header-anchor",href:"#what-is-modding","aria-hidden":"true"},"#"),a(' What is "modding"?')],-1),T=a("Modding is a term borrowed from osu!. It is the process of reviewing and providing feedback for a map via editor and/or in-game analysis. Maps have to go through this process to eventually end up ranked in ScoreSaber. See "),q={href:"https://bit.ly/ScoreSaberModding",target:"_blank",rel:"noopener noreferrer"},J=a("this"),S=a(" guide to get started with modding maps."),I=e("h2",{id:"get-a-mod-from-a-ranking-team-member",tabindex:"-1"},[e("a",{class:"header-anchor",href:"#get-a-mod-from-a-ranking-team-member","aria-hidden":"true"},"#"),a(" Get a mod from a Ranking Team member")],-1),_=a("Before you contact a ranking team member in order to have your map ranked, please pay attention to their queue rules. A mod is a list of changes to make in a map that are issues within said map. It can range anywhere from playability issues to rank-ability issues with the "),N=a("ranking criteria"),O=a(". This step can generally take anywhere from an hour to a month depending on ranking team activity and song of choice. You work with the RT member to fix all the ranked issues with the maps and work through any listed playability issues. Generally requests are handled by looking for open ranking queues in ScoreSaber's Discord server. The green circles indicate queues that are open for maps."),Z=m('<p><img src="'+p+'" alt="Discord Modding Example"></p><p>Once you read the rules of the modder and made sure that your map matches said rules, send them a direct message asking for a spot in queue. Generally, having information like the song title, song artist, BPM, length of the song, number of difficulties going for rank, are helpful to include in your message since they can make team members more interested in choosing your maps. If a person from the team accepts your map, they will explicitly tell you they have. You shouldn&#39;t have multiple people modding your map at the same time to avoid having overlapping mods and wasting someone&#39;s time.</p><h2 id="optional-get-a-mod-from-a-student" tabindex="-1"><a class="header-anchor" href="#optional-get-a-mod-from-a-student" aria-hidden="true">#</a> (Optional) Get a mod from a Student</h2><p>Student modding queues are from people who are working towards becoming a member of the ranking team. They have their mods checked by a member of the ranking team which acts as their mentor.</p><div class="custom-container warning"><p class="custom-container-title">Attention</p><p>Student mods are a great way of getting ranking team eyes on a map, however this process takes extra time compared to a direct mod from a ranking team member. This doesn&#39;t guarantee the map will enter queue, it will depend on the student&#39;s mentor to decide if they want to help you ranking your map.</p></div><h2 id="work-on-the-map-when-you-get-the-mod" tabindex="-1"><a class="header-anchor" href="#work-on-the-map-when-you-get-the-mod" aria-hidden="true">#</a> Work on the map when you get the mod</h2><p>Once you have received the mod, acknowledge it and work to fix the map in a timely manner. Don&#39;t rush for fixes, but remember that fixing it when the map is still fresh in both you and the modder&#39;s mind can be beneficial in working towards a better map.</p><p>A mod will generally be a line by line list of issues with the map. Sorted by beat number, issue severity, and the issue itself. Example of a mod:</p><p><img src="'+u+'" alt="Mod Example"></p><p>While everyone&#39;s system for making a mod is different, anything labeled as &quot;Unrankable&quot; or &quot;Questionable&quot; requires justification on the mapper&#39;s part as to why it is not fixed or why is it that way.</p><p>The mapper will make changes to their map and justify what they didn&#39;t change. While it is not required to make changes based on suggestions, doing so will generally make your map better, and the modder will appreciate his efforts being rewarded.</p><div class="custom-container tip"><p class="custom-container-title">TIP</p><p>If a modder doesn&#39;t respond in a week or so feel free to remind them unless they have explicitly stated a timeframe they will be unavailable. Modder&#39;s have other obligations that require their time but things are occasionally forgotten.</p></div><h2 id="put-the-map-in-the-ranking-queue" tabindex="-1"><a class="header-anchor" href="#put-the-map-in-the-ranking-queue" aria-hidden="true">#</a> Put the map in the ranking-queue</h2><p>Once all of the above is done, it is now time for the ranking team member to add your map into the ranking-queue. This doesn&#39;t mean your map will be ranked as is, but it will eventually end up ranked. The ranking team member should in the end be asking you for the leaderboard IDs.</p><p><strong>Example of a leaderboard ID:</strong></p><p><img src="'+l+'" alt="Leaderboard ID Example"></p><p>If your map consists of more than one difficulties, you will need to provide the ID of each difficulty, preferably in the following format:</p><p><img src="'+c+'" alt="Leaderboard ID Format"></p><h2 id="wait-for-the-map-to-go-through-the-ranking-queue" tabindex="-1"><a class="header-anchor" href="#wait-for-the-map-to-go-through-the-ranking-queue" aria-hidden="true">#</a> Wait for the map to go through the ranking-queue</h2><p>At this point the mapper (you) may receive feedback in the form of a QAT downvote indicating that said map should be fixed. QAT votes affect queue position so having a positive rating is beneficial. If a map is re-uploaded, the initial modder who put the map in queue should be notified. Every new upload requires a new set of leaderboards so it is advised to take feedback in batches and upload when only needed. You should always reupload after fixing a map with ranking team or QAT.</p><p>Once the map reaches the top of queue, other ranking team members will mod through the map and find any issues within it. If you are sent a DM by someone on the ranking team, you should fix any issues with the map and reupload it. The new leaderboards should be sent to the last person who sent you a mod.</p><p>At 3 RT upvotes and 0 downvotes your map gets qualified. The map gets increased attention due to its qualified status and issues are generally presented to the mapper. The mapper can then reupload the map as necessary before the map is officially ranked. This period is of 7 days. If the map is reuploaded then the 7 day period is reset.</p><h2 id="your-map-is-now-ranked" tabindex="-1"><a class="header-anchor" href="#your-map-is-now-ranked" aria-hidden="true">#</a> Your map is now ranked</h2><p>Congratulations! The 7 days of qualified period has passed, and your map is now considered ranked.</p><div class="custom-container danger"><p class="custom-container-title">\u26A0\uFE0F ATTENTION</p><p>You must never make your ranked maps unavailable to players. If you violate this rule, you will be banned from ranking any maps on ScoreSaber in the future.</p></div>',25);function B(D,V){const o=i("RouterLink"),r=i("ExternalLinkIcon");return d(),h("div",null,[f,y,e("ol",null,[k,e("li",null,[w,t(o,{to:"/ranking/criteria/"},{default:n(()=>[b]),_:1})]),v]),A,x,e("p",null,[T,e("a",q,[J,t(r)]),S]),I,e("p",null,[_,t(o,{to:"/ranking/criteria/"},{default:n(()=>[N]),_:1}),O]),Z])}const R=s(g,[["render",B],["__file","how-to-rank-map.html.vue"]]);export{R as default};
